import React from 'react';
const Synchfour =()=>{
    return(
        <>
            <h1>Synchronous 4-bit</h1>
            <form>
              <input type="text" className="inp" id="dff1" placeholder="1,2,3.."/> 
              <input type="text" className="inp" id="dff2" placeholder="1,2,3.."/> 
              <input type="text" className="inp" id="dff3" placeholder="1,2,3.."/>  
            </form>
        </>
    );
};
export default Synchfour;
